import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card"
import Sdata from "./Sdata"
import css from "./index.css"

function nCard(val) {
   return(
      <Card
      imgsrc={val.imgsrc}
      title={val.title}
      sname={val.sname}
      links={val.links}
   />
   );
}

ReactDOM.render(
   <>
   <h1>Wellcome To netflix Official Site</h1>

  {Sdata.map(nCard)}
  </>,

   document.getElementById("root")
);
